import './cta.css';

const CTA = () => {
  return (
    <div className='cc__cta section__padding'>
      <div className='cc__cta-container'>

        <h1>So what are you waiting for? let's join the code camp and feel the benefits.</h1>
        <button type='button'>Register</button>
      </div>
    </div>
  )
}

export default CTA
